import React from 'react';
import ReactTable from 'react-table';

import 'react-table/react-table.css';

const Table = ({ pageSize, columns, data, ...rest }) => {
  return (
    <ReactTable
      data={data}
      columns={columns}
      // pageSize={pageSize}
      showPagination
      {...rest}
    />
  )
};

export default Table;
